INSERT INTO `news` (`id`, `author`, `title`, `type`, `content`, `views`, `created_at`, `updated_at`) VALUES
(1, 'Test', 'Test', 'General', '<p><strong>[Resolved]&nbsp;</strong>We have resolved this issue.</p><p>Hey players,</p><p>We are aware of a situation regarding our voting system where you are not receiving the NX you should be getting. <b>Rest assured, your votes are still being counted and your NX will be distributed at a later time.</b></p><p><b>To reiterate, your NX will be distributed at a later time. We\'ll update this post and on the Discord & Forums when we have more information.</b></p><p>We apologize for the inconvenience and thank you for your patience.</p><p>- Lumiere Network</p>', 12, '2018-11-17 23:00:00', '2018-11-17 23:00:00'),
(2, 'Test', 'Test', 'General', '<p><strong>[Resolved]&nbsp;</strong>We have resolved this issue.</p><p>Hey players,</p><p>We are aware of a situation regarding our voting system where you are not receiving the NX you should be getting. <b>Rest assured, your votes are still being counted and your NX will be distributed at a later time.</b></p><p><b>To reiterate, your NX will be distributed at a later time. We\'ll update this post and on the Discord & Forums when we have more information.</b></p><p>We apologize for the inconvenience and thank you for your patience.</p><p>- Lumiere Network</p>', 12, '2018-11-17 23:00:00', '2018-11-17 23:00:00');
